import '../LoginRegister.css';
import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import decode from 'jwt-decode';
import Header from '../components/Header';
import FeatureLinks from '../components/FeatureLinks';
import {toast} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

toast.configure();

class DEF extends Component{

render(){

return(
<div>
    <Header></Header>

<img class="wave" src="img/wave.svg"/>
    <div class="logincontainer">
        <div class="img">
            <img src="img/authentication.svg"/>
        </div>
        <div class="login-container">
            <form action="login.html" class="divform">
                <h2>Entrar</h2>
                <p>Welcome back!</p>
                <div class="input-div one">
                    <div class="i">
                        <i class="fas fa-user"></i>
                    </div>
                    <div>
                        <h5>Usuário</h5>
                        <input class="input" type="text"/>
                    </div>
                </div>
                <div class="input-div two">
                    <div class="i">
                        <i class="fas fa-key"></i>
                    </div>
                    <div>
                        <h5>Senha</h5>
                        <input class="input" type="password"/>
                    </div>
                </div>
                <input type="submit" class="btn" value="Entrar"/>
                <a class="forgot" href="forgotPassword.html">Esqueceu sua senha ?</a>
               
               
                <div class="account">
                    <p>Ainda não possui conta ?</p>
                    <a href="register.html">Cadastre-se</a>
                </div>
            </form>
        </div>
    </div>
    </div>

)
}

}

export default DEF;
